import React from 'react'
import HeaderComponent from '../../Components/InnerComponents/HeaderComponent'

export default function Notice() {
  return (
    <div>
      <div id='innerHero'>
        <HeaderComponent name='Notice ' description='View all the notices here' />
      </div>
    </div>
  )
}
